import './App.css';
import  Login  from './componentes/auntentificacion/Login';
import { BrowserRouter as Route, Router, Switch } from 'react-router-dom';
import Cuenta from './componentes/auntentificacion/Cuenta';
import Proyectos from './componentes/proyectos/Proyectos';



function App() {
  return (
    <Router>
        <Switch>
            <Route exact path="/" components={Login}/>
            <Route exact path="/"cuenta components={Cuenta}/>
            <Route exact path="/"proyectos components={Proyectos}/>        
        </Switch>
    </Router>
  );
}

export default App;
